    false,nt"url": null,nt"notes": "An attempt to establish a breeding population
    of Atlantic puffin colony using artificial and modified burrows on Petit Manan Island
    resulted in 3 of 17 burrows being used by puffins. Two chicks were presumed fledged
    and one egg was laid but eventually disappeared, perhaps preyed upon by gulls or
    razorbills. Numbers of birds present on and around the colony were greatest in June
    and August. A temporary decline in July may have been due to disturbances of the
    colony. Suggestions for burrow modifications in future projects include construction
    of completely dry and dark burrows with nesting chambers.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
